import './App.css';
import Book from './Book';
import Preloader from './Preloader';

const App = props => {
  return props.isLoading ? <Preloader/> : (
    <div className="App">
      <Book name='JS' year='2019' price='2000'/>
      <Book name='React' year='2021' price='1000'/>
      <Book name='Vue' year='2020' price='1700'/>
    </div>
  );
}

export default App;
